import React from 'react'

import ExpenseItem from "./ExpenseItem";
import NewExpenseComp from "./NewExpenseComp";

function Expenses({expences}) {
  return (
    <div className='expenses' >
        {expences.map((item, i) => {
        return (
          <ExpenseItem
          key={item.id} 
          title={item.title}
          amount={item.amount}
          date={item.date} />
        )
      })}
      {expences.map((item, i) => {
        return (
          <NewExpenseComp
          key={item.id} 
          title={item.title}
          amount={item.amount}
          date={item.date} />
        )
      })}
    </div>
  )
}

export default Expenses
